INSERT INTO `products` VALUES (1,'Máy Lọc Không Khí Xiaomi Mi Air Purifier Pro H','src/main/resources/static/img/',4900000,'Máy lọc không khí Xiaomi Purifier Air Pro H được trang bị bộ lọc HEPA H13 có diện tích lớn, cho công suất lọc hiệu quả, loại bỏ formaldehyd, các hạt PM2.5, các chất gây dị ứng, vi khuẩn và mùi hôi, trả lại không khí trong lành cho không gian sống. Với thiết kế máy lọc thông minh,tuổi thọ bộ lọc cao cùng khả năng kết nối App, điều khiển bằng giọng nói, hứa hẹn sẽ đem lại cho người dùng những trải nghiệm sử dụng tuyệt vời.','Vẫn sở hữu thiết kế tối giản như các thế hệ trước, Purifier Air Pro H có thiết kế hình trụ, màn hình OLED phía mặt trước cùng tone màu trắng thanh lịch có khả năng tương thích với nhiều phong cách nội thất khác nhau. Các thông số sẽ được hiển thị trên màn hình OLED bao gồm chế độ hoạt động, nhiệt độ môi trường, độ ẩm và chỉ số không khí. Nếu không khí trong lành, thanh hiển thị các chỉ số sẽ có màu xanh lá cây. Nếu không khí trong phòng bị ô nhiễm nhẹ, thanh sẽ có màu cam và nếu ô nhiễm không khí nghiêm trọng, nó sẽ có màu đỏ.  Máy lọc không khí Purifier Air Pro H cung cấp tới 6 chế độ sử dụng, đáp ứng các nhu cầu sử dụng khác nhau, bao gồm chế độ yêu thích tùy chỉnh, chế độ ngủ và chế độ mặc định. 3 chế độ còn lại gồm tốc tốc độ thấp, trung bình và tốc độ cao. Tất cả được điều khiển bằng phím cảm ứng. Người dùng có thể sử dụng chế độ thấp mở trong thời gian dài, dùng để giữ cho không khí trong nhà sạch sẽ. Khi điều kiện không khí không tốt người dùng có thể sử dụng chế độ trung bình hoặc cao để thanh lọc nhanh chóng.  Thiết kế tối giản, thân thiện với người dùng của Xiaomi Pro H',0,1,'dc57e950-8986-49dc-ac38-51abff3ab8f5',1,NULL),(2,'Xiaomi Air Purifier 4 Compact','src/main/resources/static/img/',1521000,'Thương hiệu: Xiaomi Model: Air Purifier 4 Compact Diện tích sử dụng hiệu quả: 16-27m² Độ ồn: ≤ 60dB (A) Cảm biến: Cảm biến hồng ngoại PM2.5 PCADR: 230m³ / h Công suất tốt đa: 27W Trọng lượng: 2,2kg','Máy lọc không khí Mi 4 Compact là một sản phẩm sáng tạo, đặc biệt cho những người nhạy cảm và dễ bị dị ứng. Nhờ trang bị bộ lọc 3 trong 1, Air Purifier 4 Compact có thể loại bỏ đến 99.97% các hạt trong không khí có kích thước 0.2 micromet cũng như lọc được bụi mịn PM2.5 như: phấn hoa, lông thú cưng và khói.  Máy lọc này có cảm biến CADR 230m³ / h và PM 2.5 IR với khả năng hút gió toàn diện 360 độ, giúp lọc không khí một cách dễ dàng trong căn phòng có diện tích lên đến 27m3. Máy được tích hợp công nghệ và khả năng cảm biến thông minh, cung cấp cảm biến thời gian thực về những thay đổi trong chất lượng không khí nhờ vào cảm biến vật chất hạt ',0,2,'ee72c159-ef9c-45cf-b81c-739b36621499',2,NULL),(3,'Máy Lọc Không Khí Xiaomi Mi Air Purifier 3C','src/main/resources/static/img/',1575000,'Mi Purifier 3C (BHR4518GL) Bộ lọc không khí: Bộ lọc HEPA tuổi thọ từ 6 - 12 tháng Độ ồn: 30,5dB Diện tích sử dụng: 15 - 35 m2 Trọng lượng: 4.6kg Dòng điện vào: AC 100- 240V 50 / 60Hz Công suất: 29W Tốc độ lọc: - Tốc độ PCADR là 320m3/h Kết nối App: App Mihome','Máy Lọc Không Khí Xiaomi Mi Air Purifier 3C có thiết kế mang đậm phong cách của nhà Xiaomi, đó là tone màu trắng quen thuộc đơn giản mà vô cùng trang nhã. Bên cạnh đó máy có trọng lượng chỉ 4,8kg vô cùng nhỏ gọn bạn có thể đặt bất cứ đâu trong căn phòng của mình. Cụ thể máy có thiết kế khối hình trụ chữ nhật xung quanh là mặt lưới dạng tổ ong để lấy gió, phía trên là cửa thoát không khí sau khi được làm sạch.  Nhà sản xuất Xiaomi cũng đặc biệt tích hợp cảm biến đo chất lượng không khí ở mặt sau thân máy. Từ đó giúp máy có khả năng nhận diện sự thay đổi các yếu đố này sau cập nhật liên tục trên màn hình OLED và đưa ra chế độ hoạt động phù hợp cho máy lọc không khí.',0,3,'580274cd-3f19-4465-b91a-9bf566f24264',3,NULL),(4,'Máy Lọc Không Khí Xiaomi Air Purifier 3H (DGW)','src/main/resources/static/img/',2900000,'Máy lọc không khí Xiaomi Air Purifier 3 tốc độ làm sạch không khí (CADR) đã được nâng cấp lên 400m3/h và công suất lọc PM2.5 tăng 29%.','Máy lọc không khí gen 3H được sản xuất bởi Xiaomi và Zhimi, có kích thước không thay đổi so với người tiền nhiệm nhưng tốc độ làm sạch không khí (CADR) đã được nâng cấp lên 400m3/h và công suất lọc PM2.5 tăng 29%.   So với thế hệ trước thì hệ thống không khí của Mi Air Purifier 3H đã được thiết kế lại để tạo ra lượng khí lớn hơn mà không làm thay đổi kích thước thân máy, và có thể cung cấp 6,660 lít không khí sạch mỗi phút.. Bên cạnh đó, công suất của Mi Air Purifier 3H cũng được nâng cấp so với thế hệ trước. Cụ thể, tốc độ làm sạch không khí (CADR) cũng được tăng lên 400m3/h và diện tích hoạt động cũng tăng thêm 11m2 lên đến 48m2. Mặc dù hoạt động với lưu lượng không khí lớn như vậy, tuy nhiên độ ồn mà máy tạo ra chỉ đạt 32.1dB (A) hầu như không gây ảnh hưởng đến giấc ngủ người dùng.   Tuy có những cải tiến về hệ thống lọc và công suất nhưng máy lọc không khí Mi Gen 3H không gây ra tiếng ồn quá lớn nhờ trang bị công nghệ giảm ồn tiên tiến. Ngay cả ở chế độ hút mạnh nhất, tiếng ồn chỉ ở mức 32.1dB, lớn hơn một chút so với tiếng thì thầm nên có thể dễ dàng đặt trong phòng ngủ mà không cần lo lắng. Công suất hoạt động tối đa chỉ 38W.   Vẫn được trang bị màn hình hiển thị OLED kiểu tròn như thế hệ trước, cung cấp các thông số như nhiệt độ, độ ẩm, giá trị PM2.5 ngay thời gian thực, trạng thái hoạt động bộ lọc, trạng thái kết nối,…Tuy nhiên sự khác biệt trên máy lọc không khí Xiaomi thế hệ 3 này chính là tối giản hóa các nút vật lý, tất cả đều được tích hợp vào màn hình OLED. Các nút được bao quanh bởi 1 vòng ánh sáng chuyển đổi phản ánh chất lượng không khí trong nhà.  Mặt khác, máy lọc không khí Mi Gen 3H còn được tích hợp chức năng điều chỉnh tốc độ gió, cung cấp cho người dùng nhiều sự lựa chọn hơn. Cảm biến hạt laser vi mô được trang bị cho khả năng phát hiện các hạt micron cỡ mịn và phản hồi sự thay đổi chất lượng không khí trong nhà ngay thời gian thực. Khi thiết bị ở chế độ tự động, nó cũng sẽ chủ động điều chỉnh để có được hiệu quả lọc không khí tốt hơn.   Giống như các thế hệ trước, máy lọc không khí Mi Gen 3H cũng có thể được kết nối với Mijia APP và hệ thống điều khiển giọng nói Xiaoai AI để hoạt động cùng với các thiết bị nhà thông minh được kết nối khác như máy điều hòa Zhimi full DC, máy làm ẩm khử trùng Zhimi, hệ thống không khí trong lành Zhimi,…',0,4,'d968d1b7-3f32-4dcc-aa3d-3cd5390ad54c',4,NULL),(5,'Máy Lọc Không Khí Xiaomi Mi Air Purifier 4 Pro','src/main/resources/static/img/',4275000,'Đặc điểm nổi bật: Siêu êm ái - tiếng ồn khi hoạt động chỉ 33 decibel Lõi lọc trang bị màng lọc không khí loại bỏ lên đến 99% Thiết kế máy cho phép lọc 360 độ, lọc ra đến 8330 lít mỗi phút Tích hợp màn hình OIed chất lượng không khí Lọc sạch mọi loại bụi bẩn / phấn hoa kích thước 2.5pm','Máy lọc không khí Xiaomi Mi Air Purifier 4 Pro là phiên bản cao cấp nhất của dòng máy lọc không khí Xiaomi Gen 4 với công suất lọc mạnh mẽ, bộ lọc HEPA 5 lớp tân tiến và vô số tính năng, cải tiến thông minh. Máy lọc không khí Xiaomi 4 Pro được trang bị bộ lọc HEPA thế hệ mới với 5 lớp lọc giúp làm sạch mọi loại bụi bẩn, khử mùi với hiệu quả cực cao. Lớp lọc đầu tiên sẽ lọc các hạt lớn như khói bụi, bụi giấy, bụi gỗ, sợi vải, tóc và lông động vật. Lớp thứ hai và thứ ba của bộ lọc sẽ loại bỏ các loại virus, kháng khuẩn như H1N1, Ecoli… với tỉ lệ lọc sạch lên tới 99%.  Lớp lọc thứ 4 là lớp lọc HEPA, có nhiệm vụ lọc toàn bộ các loại bụi mịn có đường kính 0,3μm trở lên, bao gồm hạt PM2.5, khói, vẩy da thú cưng, phấn hoa, bông và thậm chí cả vi khuẩn gây bệnh. Lớp lọc cuối cùng được làm bằng than hoạt tính chất lượng cao giúp hấp thụ formaldehyd và các hóa chất độc hại khác đồng thời có thể khử các mùi hôi gây khó chịu trong không gian nhà bạn.  Hệ thống đường dẫn khí của máy cũng được nhà sản xuất tối ưu, tăng tốc độ làm sạch không khí CARD Formaldehyd và CARD Toluene của máy lên đến 200m3/h và 147m3/h, giúp nhanh chóng lọc sạch mọi loại bụi bẩn, mang đến bầu không khí trong lành, thư giãn nhất cho bạn và gia đình',0,5,'a11709a5-d9bb-4e42-85c8-cce3806934bf',5,NULL),(6,'Máy Lọc Không Khí Xiaomi Smartmi Jya Fjord','src/main/resources/static/img/',4671000,'Công nghệ NanoGuard độc quyền với hiệu suất lọc sạch lên tới 99,95% Thiết kế sang trọng, cao cấp Tiệt trùng bằng tia UV tân tiến, tiêu diệt hiệu quả virus và vi khuẩn trôi nổi trong không khí Thanh lọc không khí, loại bỏ 99,99% chất gây ô nhiễm không khí chỉ sau vài phút Cảm biến theo dõi chất lượng, nhiệt độ và độ ẩm không khí trong nhà Màn hình cảm ứng OLED sắc nét, thông minh Điều khiển thông minh qua Smartmi Link APP Điều khiển bằng giọng nói với Apple HomeKit, Amazon Alexa, Google Assistant','Máy lọc không khí Jya Fjord có hiệu suất lọc khí vô cùng mạnh mẽ, với tỷ lệ phân phối không khí sạch CADR lên tới 450m3/h và TVOC CADR 150m3/h, phù hợp với không gian nhà có diện tích từ 31-54m2. Bên cạnh đó, cứ sau 10 đến 15 phút, máy sẽ tự động tái tạo không khí trong phòng, giữ bầu không khí trong nhà luôn tươi mát, sạch sẽ và trong lành mọi lúc.  Tùy thuộc vào mức độ làm sạch, độ ồn của máy sẽ dao động trong khoảng 18,8 dB (A) ở chế độ ngủ và lên đến 66 dB (A) ở mức cao nhất. Ở chế độ ngủ hoặc ở mức thấp, độ ồn của máy vô cùng nhỏ, hầu như không thể nghe thấy, đảm bảo không làm ảnh hưởng tới giấc ngủ của bạn và người thân trong gia đình. Máy lọc không khí Jya Fjord Air Purifier có thể dễ dàng kết nối và điều khiển từ xa thông qua ứng dụng Smartmi trên điện thoại. Sau khi kết nối thành công, bạn có thể tùy ý bật/tắt máy, thay đổi các chế độ lọc khí, theo dõi chất lượng không khí, hẹn giờ, khóa trẻ em, tắt âm… cũng như theo dõi báo cáo chất lượng không khí theo ngày, tuần và tháng.  Ngoài ra, máy cũng có thể điều khiển được bằng giọng nói với thông qua Google Home, Apple HomeKit và Amazon Alexa.',0,6,'de5d528f-5738-4f41-b3ae-23a39549c97b',6,NULL),(7,'Máy tiệt trùng sấy khô UV Fatzbaby FB4706SL','src/main/resources/static/img/',1990000,'Máy tiệt trùng sấy khô bình sữa UV Fatzbaby FB4706SL sử dụng để diệt khuẩn, làm khô các vật dụng cho bé yêu như bình sữa, đồ dùng hàng ngày hạn chế vi khuẩn xâm nhập ảnh hưởng tới sức khỏe.','Công nghệ diệt khuẩn bằng tia UV là phương pháp hiện đại, được áp dụng nhiều trong y khoa, có thể tiêu diệt tất cả các vi sinh vật gây hại, đây được xem là phương pháp tiệt trùng hiệu quả nhất hiện nay.  Chỉ từ 10 đến 15 phút, máy tiệt trùng bình sữa Fatzbaby FB4706SL có thể bảo quản các vật dụng trong môi trường vô trùng sau 72 giờ đồng hồ.​',0,7,'34711eac-e451-4fe2-b5fb-1ad094278655',7,NULL),(8,'Máy tiệt trùng UVC LED King Pro 1 FB4816SL','src/main/resources/static/img/',1990000,'Máy tiệt trùng sấy khô UVC LED King Pro 1 sở hữu thiết kế hai ngăn chứa với hai cửa riêng biệt có thể tiệt trùng và sấy khô đồ dùng cho bé và các vật dụng gia đình cùng lúc.','Máy có thể tích lớn 35 lít có thể chứa 12 bình cổ rộng, 5 bát, 6 đĩa và các vật dụng nhỏ khác.  Máy tiệt trùng Fatzbaby UVC LED King Pro 1 có lõi thiết kế đặc biệt được làm bằng thép không gỉ siêu gương để tối đa hóa khả năng phản xạ tia UV. Ngoài ra, máy trang bị đèn tuýp UVC LED lớn với 8W giúp tiệt trùng hiệu quả được bảo hành 3 năm và có tuổi thọ lên tới 6 năm sử dụng. Fatzbaby UVC LED King Pro 1 tích hợp 6 chế độ như: tự động, tiệt trùng, sấy khô, bảo quản, lên men và sấy hoa quả. Máy có chức năng tự động tắt và bật đèn LED khi cửa bị mở.  Bảng điều khiển màn hình LED bằng nút cảm ứng bạn có thể điều chỉnh thời gian tiệt trùng, sấy khô,... Bên cạnh đó, máy trang bị cửa sổ quan sát hoạt động của máy từ bên ngoài.',0,8,'5c569e42-ae1a-4252-ab88-111ba864c486',8,NULL);
